Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('12','Cardiology','This department provides medical care to patients who have problems with their heart or circulation. It treats people on an inpatient and outpatient basis.','1');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('13','Chaplaincy','Chaplains promote the spiritual and pastoral wellbeing of patients, relatives and staff.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('14','Critical care','Sometimes called intensive care, this unit is for the most seriously ill patients.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('15','Diagnostic imaging','Formerly known as X-ray, this department provides a full range of diagnostic imaging services.','3');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('16','Discharge lounge','Many hospitals now have discharge lounges to help your final day in hospital go smoothly.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('17','Ear nose and throat (ENT)','The ENT department provides care for patients with a variety of problems','8');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('18','Elderly services department','Led by consultant physicians specialising in geriatric medicine, this department looks after a wide range of problems associated with the elderly.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('19','Endoscopy','Endoscopy involves a small thin tube with a camera on the end.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('20','Gynaecology','These departments investigate and treat problems of the female urinary tract and reproductive organs, such as endometritis, infertility and incontinence.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('21','Haematology','Haematology services work closely with the hospital laboratory.These doctors treat blood diseases and malignancies linked to the blood, with both new referrals and emergency admissions being seen.','7');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('22','Maternity departments','Women now have a choice of who leads their maternity care and where they give birth.Care can be led by a consultant, a GP or a midwife.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('23','Microbiology','The microbiology department looks at all aspects of microbiology, such as bacterial and viral infections.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('10','Accident and emergency','This department (sometimes called Casualty) is where you''re likely to be taken if you''ve called an ambulance in an emergency.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('24','Neonatal unit','Neonatal units have a number of cots that are used for intensive, high-dependency and special care for newborn babies.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('25','Nephrology','This department monitors and assesses patients with kidney (renal) problems.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('11','Anaesthetics','Doctors in this department give anaesthetic for operations.','8');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('26','Neurology','This unit deals with disorders of the nervous system, including the brain and spinal cord. It''s run by doctors who specialise in this area (neurologists) and their staff.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('27','Nutrition and dietetics','Trained dieticians and nutritionists provide specialist advice on diet for hospital wards and outpatient clinics, forming part of a multidisciplinary team.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('28','Obstetrics and gynaecology units','Overseen by consultant obstetricians and gynaecologists, there is a wide range of attached staff linked to them, including specialist nurses, midwives and imaging technicians.','7');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('29','Occupational therapy','This profession helps people who are physically or mentally impaired, including temporary disability after medical treatment. It practices in the fields of both healthcare and social care.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('30','Oncology','This department provides radiotherapy and a full range of chemotherapy treatments for cancerous tumours and blood disorders.','6');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('31','Ophthalmology','Eye departments provide a range of ophthalmic services for adults and children','7');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('33','Pain management clinics','Usually run by consultant anaesthetists, these clinics aim to help treat patients with severe long-term pain that appears resistant to normal treatments','1');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('32','Orthopaedics','Orthopaedic departments treat problems that affect your musculoskeletal system. That''s your muscles, joints, bones, ligaments, tendons and nerves','2');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('34','Pharmacy','The hospital pharmacy is run by pharmacists, pharmacy technicians and attached staff.
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('35','Physiotherapy','Physiotherapists promote body healing, for example after surgery, through therapies such as exercise and manipulation','5');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('36','Radiotherapy','Run by a combination of consultant doctors and specially trained radiotherapists, this department provides radiotherapy (X-ray) treatment for conditions such as malignant tumours and cancer','6');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('37','Renal unit','Closely linked with nephrology teams at hospitals, these units provide haemodialysis treatment for patients with kidney failure. Many of these patients are on waiting lists for a kidney transplant','2');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('38','Rheumatology','Specialist doctors called rheumatologists run the unit and are experts in the field of musculoskeletal disorders (bones, joints, ligaments, tendons, muscles and nerves).','1');
Insert into HR.DEPARTMENT (ID_DEPT,NAME,DESCRIPTION,FLOOR) values ('39','Urology','The urology department is run by consultant urology surgeons and their surgical teams. It investigates all areas linked to kidney and bladder-based problems','3');
