   for each row 
begin  
   if inserting then 
      if :NEW."ID_APPOINTMENT" is null then 
         select AUTO_INCREMENT_SEQ.nextval into :NEW."ID_APPOINTMENT" from dual; 
      end if; 
   end if; 
end;
/
ALTER TRIGGER "HR"."AUTO_INCREMENT_TR_APPOINTMENT" ENABLE;


DROP SEQUENCE AUTO_INCREMENT_SEQ;
CREATE SEQUENCE AUTO_INCREMENT_SEQ INCREMENT BY 1 START WITH 1590 MAXVALUE 999999 MINVALUE 1 CACHE 20;
